import React from "react";
import {useSelector} from "react-redux";
function Card(props) {

    const search = useSelector((state) => state.search);
    let song = search.songs?(search.songs.data.results.map(function(song){
      return  <div>
            <h1>
                {song.artistName}
            </h1>

        </div>
    })):(<h1>loading</h1>)

  return (
    <div>
       {song}
    </div>
  )
}

export default Card;
